import React from 'react';
import PropTypes from 'prop-types';
import { HTTP_STATUS } from '@talend/react-cmf/lib/middlewares/http/constants';
import { Inject } from '@talend/react-cmf';

import { Layout, HttpError } from '@talend/react-components';
import { SidePanel } from '@talend/react-containers';

const commonStyle = {
	height: '60rem',
	backgroundPosition: 'left bottom',
	backgroundRepeat: 'no-repeat',
};

const forbiddenStyle = {
	...commonStyle,
	backgroundPositionX: '10rem',
	backgroundImage:
		'url("data:image/svg+xml;base64,")',
};

const notFoundStyle = {
	...commonStyle,
	backgroundPosition: '10rem 22rem',
	backgroundSize: '402px 345px',
	backgroundImage:
		'url("data:image/svg+xml;base64,")',
};

function getStyle(status) {
	if (status === HTTP_STATUS.NOT_FOUND) {
		return notFoundStyle;
	} else if (status === HTTP_STATUS.FORBIDDEN) {
		return forbiddenStyle;
	} else if (status === HTTP_STATUS.INTERNAL_SERVER_ERROR) {
		return commonStyle;
	}

	return {};
}

function HttpErrorView({ status, title, message, sidepanel, hasTheme }) {
	const style = getStyle(status);
	const sidePanelCompponent = <SidePanel {...sidepanel} />;
	return (
		<Layout
			hasTheme={hasTheme}
			header={<Inject component="HeaderBar" />}
			mode="TwoColumns"
			one={sidePanelCompponent}
		>
			<HttpError {...{ status, title, message, sidepanel }} style={style} />
		</Layout>
	);
}

HttpErrorView.STATUS = HTTP_STATUS;
HttpErrorView.displayName = 'HttpErrorView';
HttpErrorView.propTypes = {
	hasTheme: PropTypes.bool,
	status: PropTypes.oneOfType([PropTypes.number,  PropTypes.string]),
	title: PropTypes.string,
	message: PropTypes.string,
	sidepanel: PropTypes.shape(SidePanel.propTypes),
};

export default HttpErrorView;
